import React from 'react';
import {
	ListItem,
	ListItemAvatar,
	ListItemText
} from '@material-ui/core';
import {ImageIcon} from '@material-ui/icons';


export default React.memo(({item})=>(
	<ListItem>
    <ListItemAvatar>
      <ImageIcon />
    </ListItemAvatar>
    <ListItemText primary={item.title?item.title:item.name} secondary="Jan 9, 2014" />
  </ListItem>
))
